import React, {Component} from 'react';
import "./assets/css/style.css"
import StartAnimation from "./components/animateComponent/StartAnimation";


class App extends Component {
    constructor(props){
        super(props)
        this.state = {
            hello: <div>Hello</div>
        }
    }



    render() {
        return (
            <div className="test">
                this.state.hello
            </div>
        );
    }


}
export default App;

